import React from 'react';
import { FetchAccount } from './MetaMaskFetch';

class ChannelList extends React.Component {
    render() {
        let countriesList
        FetchAccount().then(sender => {
            const countries = JSON.parse(localStorage.getItem("PayMentChannels") || "[]")
            console.log(countries)
            countriesList = countries.length > 0
                && countries.map((item) => {
                    return (
                        <option key={item} value={item}>{item}</option>
                    )
                }, this);

            // this.setState({ 'sender': sender })
            // console.log(this.state.sender)
        })
            .catch(err => {
                console.log(err)
            })


        return (
            <div>
                <select id="channelId" onChange={this.props.onChange}>
                    {countriesList}
                </select>
            </div>
        );
    }
}

export default ChannelList;
